graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "source" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>source</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "target" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>target</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "source" -> "target" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left"><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">attr1</td><td align="left" balign="left">value1</td></tr><tr><td align="left" balign="left">attr2</td><td align="left" balign="left">value2</td></tr></table></td></tr></table>>, labelOverlay="75%", edgeURL="#L1:7-1:46", attr1="value1", attr2="value2"];
}
